<!-- HMI module -->
<div class="flex w-full h-full justify-center items-center font-mono">
<script>
const color = ["red","#00FF4D","FFF600"];
let counter = 0;
function changecolor(objectid){
    const objectchange = document.getElementById(objectid);
    if (objectchange){
        objectchange.setAttribute("fill",color[counter % color.length]);
        counter ++;
    }
}

function hmiUpdateValue(id, value) {
    if (value != undefined && !Number.isNaN(value)) {
        let elem = document.getElementById(id).firstElementChild;
        if (elem) {
            elem.innerHTML = value.toFixed(1);
        }
    }
}

function hmiUpdateTemperature(id, value) {
    const gauge = document.getElementById(id);
    if (gauge) {
        if (value < 30) {
            gauge.setAttribute("fill", color[1]);
        } else if (value < 60) {
            gauge.setAttribute("fill", color[2]);
        } else {
            gauge.setAttribute("fill", color[0]);
        }
        gauge.setAttribute("height", 69 - (69/value));
    }
}

function hmiTestColours() {
    setInterval(() => {
        hmiUpdateTemperature("gauge_1_fill", Math.random() * 100);
        hmiUpdateTemperature("gauge_2_fill", Math.random() * 100);
        hmiUpdateTemperature("gauge_3_fill", Math.random() * 100);
    }, 800);
}
hmiTestColours();


</script>
